import React from 'react'
import { toast } from "react-toastify";
toast.success("Reminder added successfully!");
toast.error("Failed to load data!");
function FAQViewer() {
  return (
    <div>
      <h1>FAQViewer</h1>
    </div>
  )
}

export default FAQViewer
